import React, { PureComponent } from 'react';
import './Stage_Foch.css';
import logo from './Logo_HOPITAL_FOCH.png';

export default function Stage_Foch () { 
        return (
            <>
            &nbsp; {/* non-breaking space */}
            <div className='row'>
                <h3 className="Title">Data Science Internship at the Foch Hospital</h3>
                <img src={logo} width="200" height="100" />
            </div>
            </>
        );
    }
